import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter, Route, Link} from 'react-router-dom';

class Shodo extends React.Component {
  render(){
    return(
      <div className="container mt-1">
        <h2>Shodo</h2>
        <p>Design and Develop with XML, CSS and JavaScript on Fitbit Ionic</p>
          <div class="row">
            <div class="contents-work col-lg-4 col-md-6 col-12">
              <div class="about-text">
                <div class="thumbnail">
                  <img src="../logo.svg" alt="test" data-toggle="modal" data-target="#img_clock05" class = "bwWrapper"/>
                </div>
              </div>
            </div>
          </div>
      </div>
    )
  }
}
export default Shodo;
